// src/Navbar.js
import React from "react";
import "./Navbar.css";

const Navbar = () => {
  return (
    <div>
      <nav>
        <ul>
          <li className="italiana-regular"> Valentina</li>
          <li>About me</li>
        </ul>
      </nav>
    </div>
  );
};

export default Navbar;
